import React from 'react'
import { Form } from 'react-bootstrap'

const Todolist = () => {
    return (
        <div>
            <Form>
                <Form.Label style={{fontSize: '2rem', fontWeight: 'light'}}>Task Master</Form.Label>
                <Form.Control type="text" placeholder="Add Task" />
            </Form>
        </div>
    )
}

export default Todolist
